import styled from "styled-components";

const ChatInputContainer = styled.div`
width: 88%;
height: 30px;
background-color: red;
display: flex;
align-items: center;
margin-top: 30px;
`
const Input = styled.input`
width: 80%;
height: 100%;
background-color: red;
display: flex;
align-items: center;
`

export const ChatInput = ()=>{
    return(
        <ChatInputContainer>
            <Input/>
        </ChatInputContainer>
    )
}

export default ChatInput;
